import {
  createBrowserRouter,
} from "react-router-dom";
import Store from './pages/store';
import BookingContext from "./context/bookingContext";



const router = createBrowserRouter([
  {
    path: "/store/123",
    element: <Store />
  },
]);

function App() {
  return (
    <BookingContext.Provider>
      <div className="App">
        <header className="App-header">
          <Store />
        </header>
      </div>
    </BookingContext.Provider>
  );
}

export default App;
